import React, { Component } from 'react';

class Clock extends Component {
  constructor() {
    super();
    const today = new Date(),
      date = today.getHours() + ' ' + today.getMinutes();
    this.state = { date: new Date() };
  }
  render() {
    return <div>{this.state.date()}</div>;
  }
}

export default Clock;
